window.bookSummaryJSON = "<p>What? You don’t know Adam Wade? Here’s your chance! Adam Wade’s personal-yet-universal stories and vulnerable delivery have made him one of the most popular storytellers and comedians in the country on \"story slam\" platforms like <i>The Moth</i> and Comedy Central’s <i>Whiplash.</i></p> <p>This Audible Original, performed on stage in front of a live audience, combines Wade’s greatest hits stories with entirely new material. It takes listeners on a guided tour through Adam’s life, starting with his humble beginnings as a geeky but lovable underdog in rural New Hampshire. Adam then lets listeners in on the support he received from his family and friends as he overcame countless obstacles to achieve his dream of making it as a comedic storyteller in New York City.</p> <p>Adam’s nuanced observations, openness, and wit transform these coming-of-age tales into funny, impactful, and universal stories of joy and hope. Wade’s stories pull listeners in, reminding them of what it is to be human and that we all experience happiness, shame, failures, triumphs, and moments of incredible courage.</p>"; 
